%pig

--register the piggybank jar
register hdfs://quickstart.cloudera:8020/user/cloudera/jars/piggybank-0.17.0.jar

--read contents from the LA dataset on HDFS
raw_data_la = LOAD '/user/cloudera/data/raw/crime/los-angeles' USING org.apache.pig.piggybank.storage.CSVLoader() AS ( ************************************************************************************** );

--remove the header record from the dataset
raw_data_la_headless = FILTER raw_data_la BY id != 'ID';

-- select only the required columns
data_la = FOREACH raw_data_la_headless GENERATE *******************,*************************** ;

-- store the final data into another file
STORE data_la INTO '/user/cloudera/data/staging/crime/los-angeles' USING PigStorage(';');
